<attribute NAME="script1" VALUE="import java.util.Random&#xd;&#xa;rnd = new Random()&#xd;&#xa;max = 2000&#xd;&#xa;total = 0&#xd;&#xa;&#xd;&#xa;def getText( start, maxWords, maxChars){&#xd;&#xa;    StringBuilder b = new StringBuilder( start )&#xd;&#xa;    int nw = 1 + rnd.nextInt( maxWords )&#xd;&#xa;    for( int w = 0; w &lt; nw; w++){&#xd;&#xa;        int nc = 1 + rnd.nextInt( maxChars )&#xd;&#xa;        for( int j = 0; j &lt; nc; j++) b.append( (char)(rnd.nextInt(26) + 65) )&#xd;&#xa;        b.append( &quot; &quot; )&#xd;&#xa;    }&#xd;&#xa;    return b.toString()&#xd;&#xa;}&#xd;&#xa;&#xd;&#xa;def add( node, min ){&#xd;&#xa;    if( total &gt;= max ) return&#xd;&#xa;    int num = rnd.nextInt(4)&#xd;&#xa;    if( num &lt; min ) num = min&#xd;&#xa;    total += num&#xd;&#xa;    for( int i = 0; i &lt; num; i++){&#xd;&#xa;        def n = node.createChild( getText( &quot;t-&quot;, 18, 12 ) )&#xd;&#xa;        n.details = getText( &quot;d-&quot;, 50, 12 )&#xd;&#xa;        n.note = getText( &quot;n-&quot;, 25, 12 )&#xd;&#xa;        int na = rnd.nextInt(8)&#xd;&#xa;        for( int j = 0; j &lt; na; j++) n.putAt( getText( &quot;an-&quot;, 1, 12 ), getText( &quot;av-&quot;, 3, 12 ) )&#xd;&#xa;        if( node.getNodeLevel(true) &lt; 16 ) add( n, min - 1 )&#xd;&#xa;        n.setFolded(true)&#xd;&#xa;    }&#xd;&#xa;}&#xd;&#xa;node.children.each{ it.delete() }&#xd;&#xa;add( node, 3 )&#xd;&#xa;c.statusInfo = &quot;${total} nodes created&quot;"/>
<richcontent TYPE="NOTE">

